import React from "react";
import data from './data'

class Card extends React.Component {
    // constructor(props) {
    //     super(props)
    // }

    render() {
        // console.log(this.props)

        return (
            data.map((e) => {
                return (
                    <div className="Pokedex">
                        <p>{e.name}</p>
                        <img src={e.image} alt={e.name}></img>
                    </div>
                )
            })
        )
    }
}

export default Card
